import axios from "axios";
import inputProcess from "./InputProcess"

export default (data, currentPage) => {
    if (data.length === 0 && currentPage === 0) {
        return axios.get(`https://content.guardianapis.com/search?api-key=cc56c111-e5a6-4922-92b8-181826199202&order-by=newest&page-size=15&show-fields=body`);
    }
    let processedData = inputProcess(data);
    return axios.get(`https://content.guardianapis.com/search?page=${currentPage}&q=${processedData}&api-key=cc56c111-e5a6-4922-92b8-181826199202&order-by=newest&page-size=15&show-fields=body`);
}
